import React from 'react';
import './VIP.css'; // Optional: Add specific styles for VIP component

const VIP = () => {
  return (
    <div className="vip-container">
      <h1>VIP Program</h1>
      <p>
        <strong>Neural Architecture Search (NAS)</strong> is a technique for automating the design of artificial neural networks used in machine learning. NAS has designed networks that are on par with or outperform hand-designed architectures. The methods for NAS are categorized into <strong>search space, search strategy, and performance estimation</strong>.
      </p>
      {/* Add more content as needed */}
    </div>
  );
};

export default VIP;
